import React, {Component} from "react";
import "./sortCard.css";

class SortCard extends Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className={"sortCard "+((this.props.cur_card==null)?"":"active")}>

            </div>
        )
    }
}

export default SortCard
